import React from "react";

const Slider = () => {
  return (
    <div className="container-fluid my-5">
      <div className="d-flex flex-row overflow-hidden ">
        <button type="button slider-button">
          <i class="bi bi-arrow-left"></i>
        </button>
        <button type="button slider-button">
          <i class="bi bi-arrow-right"></i>
        </button>

        <div className="col-4 bg-dark rounded">1</div>
        <div className="col-4 bg-white rounded">2</div>
        <div className="col-4 bg-primary rounded">3</div>
        <div className="col-4 bg-success rounded">4</div>
        <div className="col-4 bg-success rounded">4</div>
        <div className="col-4 bg-success rounded">4</div>
        <div className="col-4 bg-success rounded">4</div>
      </div>
    </div>
  );
};

export default Slider;
